func NewBitflyer(userConfig map[string]interface{}) *Bitflyer {
	p := &bitflyer{}
	p.Init(userConfig)
	return &Bitflyer{
		bitflyer:      p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}

